import React from 'react';
import {Component} from 'react';
import Nav from '@bit/react-bootstrap.react-bootstrap.nav';
import Navbar from '@bit/react-bootstrap.react-bootstrap.navbar';


class Navibar extends Component {
    render() {
    return (
        <nav className="navbar navbar-expand-lg navbar-dark"  defaultActiveKey="/dashboard"
            style= {{
                backgroundColor: "#447ED9"
            }}
        >
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mr-auto">
            <li className="nav-item">
                <a className="nav-link" href="/dashboard" style = {{
                    paddingRight: "30px",
                    paddingLeft: "30px"
                }}>Dashboard <span className="sr-only">(current)</span></a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="/log" style = {{
                    paddingRight: "30px"
                }}>Log</a>
            </li>

            <li className="nav-item">
                <a className="nav-link " href="/EBS_Management" >EBS Management</a>
            </li>
            </ul>

        </div>
        </nav>

        // <Navbar bg="#447ED9" variant="dark" style={{ minWidth: 700 }}>
        //     <Nav className="mr-auto">
        //         <Nav.Link href="/dashboard">Dashboard</Nav.Link>
        //         <Nav.Link href="/log">Features</Nav.Link>
        //         <Nav.Link href="/ebs-management">EBS_Management</Nav.Link>
        //     </Nav>
        // </Navbar>


        )
    }
}


export default Navibar;
